public void setIntegerValue(Integer newValue) {

	javax.swing.JCheckBox bitCheckBoxes[] =
	{
		getBitCheckBox1(),
		getBitCheckBox2(),
		getBitCheckBox3(),
		getBitCheckBox4(),
		getBitCheckBox5(),
		getBitCheckBox6(),
		getBitCheckBox7(),
		getBitCheckBox8(),
		getBitCheckBox9(),
		getBitCheckBox10(),
		getBitCheckBox11(),
		getBitCheckBox12(),
		getBitCheckBox13(),
		getBitCheckBox14(),
		getBitCheckBox15(),
		getBitCheckBox16()
	};

	Integer tempValue = new Integer(newValue.intValue());
	
	for(int i = bitCheckBoxes.length;i>0;i--)
	{
		if( (tempValue.doubleValue()/Math.pow(2,(new Integer(i-1)).doubleValue())) >= 1 )
		{
			bitCheckBoxes[i-1].setSelected(true);
			tempValue = new Integer(tempValue.intValue() % (new Double(Math.pow(2,(new Integer(i-1)).doubleValue()))).intValue() );
		}
	}
}
